supplies_replace_action_at_setting = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 4, 1, 1, 25), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 4))).clone(namedValues=NamedValues(("eStopAtLow", 1), ("eStopAtOut", 2), ("eOverrideAtOut", 4)))).setLabel("supplies-replace-action-at-setting").setMaxAccess("readwrite")
if mibBuilder.loadTexts: supplies_replace_action_at_setting.setStatus('optional')
if mibBuilder.loadTexts: supplies_replace_action_at_setting.setDescription('This object can be used to change the setting of menu item REPLACE SUPPLIES. The behavior of the printer when a supply reaches low changes in accordance with the setting of this PML Object. If the option eStopAtLow is selected printer will stop when a supply reaches LOW. If the option eStopAtOut is selected then printer will stop when a supply reaches OUT. If the options eStopAtMaxLife (supported only on Mono products) is selected, the printer will continue past supply OUT. If the option eOverrideAtOut or eOverrideAtOut2 (supported only on Color products) is selected then printer will continue past OUT in override mode. This option is not writeable. That is using this PML object the setting could be changed to any option other than eOverrideAtOut and eOverrideAtOut2. Additional information: This PML object can be used to change the setting of the menu item REPLACE SUPPLIES. The behavior of the printer when a supply hits low changes in accordance with the setting of this PML Object. 1. eStopAtLow - Printer will stop when a supply reaches low. 2. eStopAtOut - Printer will stop when a supply reaches out. 3. eOverrideAtOut - Printer will continue print past out in override mode.')
cartridge_out_override_control = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 4, 1, 1, 27), Integer32()).setLabel("cartridge-out-override-control").setMaxAccess("writeonly")
if mibBuilder.loadTexts: cartridge_out_override_control.setStatus('optional')
if mibBuilder.loadTexts: cartridge_out_override_control.setDescription('This PML object is used to control Cartridge Out Override feature. Additional information: This object is used for the following purposes: 1. Enable/disable cartridge out override through SUPPLIES_REPLACE_ACTION_AT_PML Object. 2. Enable/disable Toner Out Limit: When toner out limit is disabled using this PML Object, engine will not be taken offline when a cartridge reaches toner out. Engine will continue to print and will be in Override mode until other limits are reached. 3. Enable/disable CRG R&D Limit: When CRG R&D limit is disabled using this PML Object, engine will not be taken offline when CRG R&D limit for printing in override is reached for any out cartridge. Engine will continue to print and will be in Override mode until other limits are reached.')
supply_out_action_support = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 4, 1, 2, 48), OctetString()).setLabel("supply-out-action-support").setMaxAccess("readonly")
