if mibBuilder.loadTexts: supply_out_action_support.setDescription("This object is used to determine if a particular capability that allows printing to continue after one or more cartridge has reached out is supported by the device. The collection bits include: cSupplyOutOverride - indicates that continuing to print with an out supply in use is supported. cMonochromePrintingAfterColorCartridgeOut - indicates that continuing to print in monochrome after a color cartridge is out is supported. cPrintingToMaxLife - indicates that printing until 'max life' is reached is supported [monochrome only]. Additional information: This object is used to determine what capabilities are supported by the device for allowing printing to continue after one or more cartridges have reached out. The collection bits include: cCartridgeOutOverride - indicates that continuing to print with an out cartridge in use is supported. cMonochromePrintingAfterColorCartridgeOut - indicates that continuing to print with monochrome after a color cartridge is out is supported.")
supply_out_device_state = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 4, 1, 2, 49), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("eNoSupplyOut", 1), ("eOffline", 2), ("eCartridgeOutOverride", 3), ("eMonochromePrintingAfterColorCartridgeOut", 4)))).setLabel("supply-out-device-state").setMaxAccess("readonly")
if mibBuilder.loadTexts: supply_out_device_state.setStatus('optional')
if mibBuilder.loadTexts: supply_out_device_state.setDescription('This PML object indicates the current behavior of the device if one or more supplies have reached out. If no supply has reached out, the value of this PML object is eNoSupplyOut. If one or more supplies have reached out, the value of this PML object will indicate if the printer is online and if so what mode is being used to continue printing. Additional information: This object indicates the current behavior of the device if one or more supplies have reached out. The enums represent: eNoSupplyOut - No supplies have reached out. eOffline - Printer is offline since one or more supplies have reached out. eCartridgeOutOverride - The cartridge override out is active. eMonochromePrintingAfterColorCartridgeOut - Monochrome printing after a color cartridge out is active.')
supply_after_out_state = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 4, 1, 2, 50), OctetString()).setLabel("supply-after-out-state").setMaxAccess("readonly")
if mibBuilder.loadTexts: supply_after_out_state.setStatus('optional')
if mibBuilder.loadTexts: supply_after_out_state.setDescription('This object is used to read and write the various status flags indicating whether the consumable was used after out. The collection bits supported include: cNotUsedAfterOut - indicates the consumable was not used in any capacity after out. If cUsedAfterOutInOverrideMode or cUsedAfterOutInMonoPrintingAfterColorOutMode is set, this flag will not be set. cInstalledWhileInOverrideMode - indicates the consumable was installed while Supply Out Override was activated. cUsedAfterOutInOverrideMode - indicates the consumable was used after out while Supply Out Override was activated. cInstalledWhileInMonoPrintingAfterColorOutMode - indicates the consumable was installed while MPACCO was activated. cUsedAfterOutInMonoPrintingAfterColorOutMode - indicates the consumable was used after out while MPACCO was activated. Additional information: This object is used to read the various status flags indicating whether the consumable was used after out. The collection bits include: cNotUsedAfterOut - indicates the consumable is not used after out. cUsedAfterOutInOverrideMode - indicates the consumable was used after out while cartridge out override was actiavted. cInstalledWhileInMonoPrintingAfterColorOutMode - indicates that the consumable was installed while MPACCO was activated. cUsedAfterOutInMonoPrintingAfterColorOutMode - indicates that the consumable was after out while MPACCO was activated.')
